    public final int getMaxNameLength() { return MAX_NAME_LENGTH; }

    public final static int
           NUM_STATES        = 539,
           NT_OFFSET         = 122,
           LA_STATE_OFFSET   = 5980,
           MAX_LA            = 2147483647,
           NUM_RULES         = 536,
           NUM_NONTERMINALS  = 202,
           NUM_SYMBOLS       = 324,
           SEGMENT_SIZE      = 8192,
           START_STATE       = 3206,
           IDENTIFIER_SYMBOL = 0,
           EOFT_SYMBOL       = 120,
           EOLT_SYMBOL       = 120,
           ACCEPT_ACTION     = 5079,
           ERROR_ACTION      = 5444;

